I Married the Waiter: Love in the Sun

Sociopolitical Documentary hosted by Norman Hull, published by ITV in 2014 - English narration


Information
------------------------------

Documentary about British women from a range of backgrounds and ages who found love while on holiday. Anne, Dawn and Jean all fell for Greek men on the island of Symi at different times. Dawn married local man Panormitis Karagiannis and now lives the traditional life of a Greek wife. Maddison, Fleur and Ruth had similar experiences with local men in Turkey. Maddison is preparing for her wedding to Isa Oksuz in Datca. The pair met when she was a children's rep and he was a windsurfing instructor. At the age of 70, Dorothy married Rafaa, a 21-year-old lad from Tunisia. But after Rafaa was refused entry into Britain, he decided to go to work in Saudi Arabia. This effectively spelt the end of their marriage and Dorothy was heartbroken. Some of the other relationships resulted in marriages that endure up to the present day. Others failed to last the course. What unites all the women interviewed here is that not one of them says she has any regrets.

